import { useState } from "react"

function Home() {

    const [ number, setNumber ] = useState(1);

    const onClick = (_) => {
        setNumber(number + 1);
    }

    return (
        <button onClick={onClick}>
            {number}
        </button>
    )

}

export default Home;
